				     Rest/binary>>,
				   N, Acc, F@_1, F@_2, F@_3, F@_4,
				   TrUserData) ->
    Key = X bsl N + Acc,
    case Key of
      8 ->
	  d_field_message_event_pb_type(Rest, 0, 0, F@_1, F@_2,
					F@_3, F@_4, TrUserData);
      16 ->
	  d_field_message_event_pb_id(Rest, 0, 0, F@_1, F@_2,
