'skip_group_map<string,attribute_value_pb>'(Bin, FNum,
					    Z2, F@_1, F@_2, TrUserData) ->
    {_, Rest} = read_group(Bin, FNum),
    'dfp_read_field_def_map<string,attribute_value_pb>'(Rest,
